(171, 'Justice, Morality, and Social Responsibility', 'A volume in Research in Social Issues in Management Series Editors: Stephen W. Gilliland, The University of Arizona, Dirk D. Steiner, Universite de Nice-Sophia Antipolis and Daniel P. Skarlicki, The University of British Columbia This volume of Research in Social Issues in Management critically examines theoretical underpinnings of organizational justice and corporate social responsibility by identifying motives underlying desires for justice and by considering responses to injustice. The first set of chapters explores issues of morality, emotions, and social exchange relationships. These can be seen as engines that drive reactions to organizational justice. The second set of chapters addresses injustice and recovery, the social systems surrounding justice, and the application of justice principles to organizations\' environmental and sustainability practices. A commentary chapter highlights ten themes that cross this interesting collection of paper on Justice, Morality, and Social Resp', '2008', 1, 0, 1, 11, 1, 1),
(172, 'Ethics: Basic Concepts and Contemporary Moral', 'Ethics is a study for knowledge ; but more than that, it is a way of living. Moral educators impart the knowledge in the hope that they be translated into the daily living of the individual, the learner; to transform his life from unrighteousness to righteousness; to affirm and realize the ultimate meaning of his being.', '2000', 1, 0, 1, 11, 1, 1),
(173, 'Knowlege, Nature, and the Good', 'Knowledge, Nature, and the Good brings together some of John Coopers most important works on ancient philosophy. In thirteen chapters that represent an ideal companion to the authors influential Reason and Emotion, Cooper addresses a wide range of topics and periodsfrom Hippocratic medical theory and Platos epistemology and moral philosophy, to Aristotles physics and metaphysics, academic scepticism, and the cosmology, moral psychology, and ethical theory of the ancient Stoics.', '2004', 1, 0, 1, 11, 1, 1),
(174, 'Introduction to Logic', 'n/a', '1995', 1, 0, 1, 11, 1, 1);

